import { jsPDF } from 'jspdf';

var regularFont = '';

const  boldFont = '';


export const addInterFont = (jsPDF: jsPDF) => {
  jsPDF.addFileToVFS('Inter-regular.ttf', regularFont);
  jsPDF.addFileToVFS('Inter-bold.ttf', boldFont);
  jsPDF.addFont('Inter-regular.ttf', 'Inter', 'normal');
  jsPDF.addFont('Inter-bold.ttf', 'Inter', 'bold');
}

